import web3 from './web3';
import ElectionFactory from './Build/ElectionFact.json'; // Make sure path is correct

// Debug log to verify ABI exists
console.log('ElectionFactory ABI:', ElectionFactory.abi);

const instance = new web3.eth.Contract(
    ElectionFactory.abi, // Use .abi directly (no JSON.parse needed)
    '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8' // Your contract address
);

export default instance;
